import React from 'react';
import axios from 'axios';
import SearchBar from './SearchBar';


class App extends React.Component {

    async onSearchSubmit(term)  {
        const response = await axios.get('https://api.unsplash.com/photos/?client_id=d4994ef03adb8936af4a3078580c7e37566d03408e933e9d594768532873023a',
            {
                params: { query : term},
                headers: {
                    Authorization : "Client-ID  d4994ef03adb8936af4a3078580c7e37566d03408e933e9d594768532873023a"
                }

            });
        console.log(response.data.results);

    }

    render() {
        return (

            <div className= "ui container" style={{marginTop: '15px'}}>
                <SearchBar onSubmitting={this.onSearchSubmit} />
            </div>
        );
    }
}

export default App;
